import React, {Component,useState, useEffect} from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
// import axios from "axios";
import Reservation from './components/Reservation'
import ReservationList from './components/ReservaionList';
import Menubar from './components/menubar';
import ManagerMenubar from './components/managerMenubar';
import FinalPage from './components/finalPage';
import DateSelect from './components/dateSelect';
import SelectPage from './components/selectPage';
import ReserveListTotal from './components/reserveListTotal';
import Adminpagemenu from './components/adminPageMenu';
import WaitingList from './components/waitingList';
import ManageSys from './components/manageSys';
import api from "./api";
import axios from 'axios';



const table = {
  'name':'김미소',
  'pet':'달구',
  'address':'부산광역시',
  'telephone':'010-0000-0000',
  'gender': '여(중성화)',
  'species' : '믹스견(장모종)'
}

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const token = 'Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJjb3PthqDtgbAiLCJpZCI6MSwiZXhwIjoxNjkyNzg1NzE4LCJ1c2VybmFtZSI6Imtha2FvXzI4OTgyMDI5NDQifQ.yFK4TqoT7I2ckMp-pQAytO5vg_IjPr1A3co2iAZMU1OJFkt1H0J2ZxGFSP4Tm-2hnwmvo1OljdxXJCyrHq25Tw';


    axios.get('/userInfo', {
      headers: {
        Authorization: `${token}`
      }
    })
      .then(response => {
        setData(response.data);
        console.log(data);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div id = 'frame' >
        {/* <div>
        {data.map((result) => (
          <li key={result.username}>{result.name}</li>
        ))}
        </div> */}

        <Menubar/>
        <Reservation/>
        {/* <FinalPage/>
        <SelectPage/>
        <ReserveListTotal/> */}


        <ManageSys/>


    </div>
  );
 }

export default App;


